sources.sass\\base\\_base.scss:
@use "../abstracts" as *;

*,
*::after,
*::before {
  margin: 0;
  padding: 0;
  box-sizing: border-box;
}

html {
  // This defines what 1rem is
  font-size: 62.5%; // 1rem = 10px; 10px/16px = 62.5%

  @include mq(big-desktop) {
    // width <= 1400
    font-size: 75%; // 1rem = 12px; 12/16 = 75%
  }

  @include mq(tab-land) {
    // width <= 1200
    font-size: 56.25%; // 1rem = 9px; 9/16 = 56.25
  }

  @include mq(tab-port) {
    // width <= 992
    font-size: 50%; // 1rem = 8px; 8/16 = 50%
  }
}

sources.sass\\abstracts\\_mixins.scss:
@use 'sass:map';


// MEDIA QUERY BREAKPOINTS!
$breakpoints: (
  phone: 35.999em, // 575px
  land-phone: 47.999em, // 768px
  tab-port: 61.999em, // 992px
  tab-land: 74.999em, // 1200px
  big-desktop: 87.499em, // 1400px
);

@mixin mq($key){
    $size: map.get($breakpoints, $key);

    @media (max-width: $size){
        @content;
    }
}

@mixin m-auto{
  width: 90%;
  margin: auto;
}

